CREATE TABLE Book2(
   id                INTEGER  NOT NULL PRIMARY KEY 
  ,book_title        VARCHAR(255) NOT NULL
  ,authors           VARCHAR(232)
  ,publication_year  INTEGER 
  ,publication_month INTEGER 
  ,publication_day   INTEGER 
  ,edition           INTEGER 
  ,publisher_name    VARCHAR(85) NOT NULL
  ,_isbn13           NUMERIC(8,6) NOT NULL
  ,language          VARCHAR(7)
  ,series            VARCHAR(119)
  ,pages             INTEGER 
);
